INSERT INTO `publicaciones` (`idpublicaciones`, `idcategoria`, `idusuario`, `fecha`, `contenido_publicacion`, `titulo_publicacion`, `estado`, `comentarios`, `imagen_logo`, `idsubcatgegoria`, `vistas`) VALUES
(21, 2, 'IMAGEN', '2020-01-22 16:10:23', '<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td><img alt=\"\" src=\"../imagenes/publicaciones/a067c948d8bc73ade595693c39f5764bIglesia.jpg\" style=\"height:200px; width:300px\" /></td>\n		</tr>\n		<tr>\n			<td>\n			<h2 style=\"font-style:italic;\"><strong>La historia de Huaytar&aacute; se remonta a la &eacute;poca prehisp&aacute;nica, muestra de ello son las diversas muestras de arquitectura dentro de su territorio, raz&oacute;n para que se le denomine &ldquo;Capital Arqueol&oacute;gica del departamento de Huancavelica El principal atractivo en la ciudad de Huaytar&aacute; es la Iglesia,&nbsp;por su arquitectura y su colorido. Esta Iglesia tiene un gran valor arqueol&oacute;gico,&nbsp;sus cimientos de roca pulida fueron las paredes de un antiguo palacio inca, en donde habitaba el curaca que gobernaba el valle.</strong></h2>\n\n			<h2 style=\"font-style:italic;\"><strong>Cuenta la tradici&oacute;n oral la palabra &ldquo;wayta&rdquo; significa flor, se le agreg&oacute;&nbsp;el sufijo &ldquo;raq&rdquo; para denominarlo Waytaraq que significa &ldquo;florecer&aacute;&rdquo; porque es la esperanza de sus pobladores ver a Huaytar&aacute; florecer econ&oacute;micamente.</strong></h2>\n\n			<h2 style=\"font-style:italic;\"><strong>La ciudad de Huaytar&aacute; se encuentra ubicada en la regi&oacute;n quechua a 2726 m.s.n.m., a 215 km. de la ciudad&nbsp; de Huancavelica v&iacute;a Rumi Chaka (los libertadores). Tiene una superficie de 6,458.39 Km.</strong></h2>\n\n			<h2 style=\"font-style:italic;\"><strong>&nbsp;Limita al norte con Castrovirreyna, Huancavelica y Angares, con Ica al&nbsp;sur-oeste, al este con Ayacucho.</strong></h2>\n			</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', 'Historia de Huaytará', 1, 1, '427689ac51de191784800dbc68c17547iglesia.jfif', 2, 4258);
INSERT INTO `publicaciones` (`idpublicaciones`, `idcategoria`, `idusuario`, `fecha`, `contenido_publicacion`, `titulo_publicacion`, `estado`, `comentarios`, `imagen_logo`, `idsubcatgegoria`, `vistas`) VALUES
(22, 2, 'IMAGEN', '2020-01-22 16:26:20', '<img src=\"data:image/jpeg;base64,\" class=\"\" style=\"margin: 0px; resize: none; position: relative; zoom: 1; display: block; height: 999px; width: 1332px; top: 0px; left: 0px;\"><div><br></div><div style=\"text-align: justify;\"><span style=\"margin: 0px; padding: 0px; text-indent: 56.6929px;\"><font face=\"Tahoma\" style=\"\" size=\"5\" color=\"#4986e7\"><b style=\"\">Cuenta la tradición, que en el lugar denominado NIÑO PUQUIO lugar muy contiguo al actual templo del Niño (unos 50 metros) existe un manantial considerado sagrado por sus visitantes, manifiestan que en ese lugar un tiempo no precisado, apareció un niño vivo y hermoso, que decía que había llegado de muy lejos para quedarse allí con su vestimenta como se le contempla hoy, jugando con otros niños de su edad que eran hijos de los pastores del lugar, a quienes les decía que quería quedarse para siempre, para lo cual deberían hacerle una casita de tal manera las apariciones eran más frecuentes, por lo que los lugareños optaron por construir un templo pequeño para el visitante, luego un buen día apareció como es hoy día, dando origen a la veneración y peregrinación de los pobladores de los lugares cercanos, sobre todo por ser un sitio apropiado como para aposento de viajeros de la costa hacia la sierra, ya que aquél entonces no había otra vía para llegar a Huamanga, Huancavelica, Lircay, Andahuaylas, Chincheros y otros lugares de la sierra central.</b></font></span><br></div>', 'Historia de Ayaví', 0, 1, '31b5541185a461eb2cf90fcb692d3906ayaviplazax.jpg', 7, 3428);
