(37, 10, 'IMAGEN', '2020-01-27 10:27:46', '<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td><img alt=\"\" src=\"../imagenes/publicaciones/a067c948d8bc73ade595693c39f5764bIglesia.jpg\" style=\"border-style:solid; border-width:3px; height:200px; width:300px\" /></td>\n		</tr>\n		<tr>\n			<td>\n			<h3><var><big><code><tt><strong>La Iglesia de Huaytar&aacute; o m&aacute;s conocido como &quot;TEMPLO INKA DE HUAYTAR&Aacute;&quot;, se encuentra ubicado sobre una terraza en la parte alta de la ciudad. Su construcci&oacute;n data del Siglo XV d.C, por orden del Inka Tupac Yupanqui en la ruta del Qhapaq &Ntilde;an.</strong></tt></code></big></var></h3>\n\n			<h3><var><big><code><tt><strong>Su edificaci&oacute;n consta de una planta rectangular con muros de sillar rosado labrado al estilo imperial de 27.40 cm de largo, 11 mt de ancho y 3.60 cm de alto; las piedras utilizadas en su construcci&oacute;n fueron tra&iacute;das desde la cantera de Inca Huasi. Destacan sus 7 Hornacinas y 1 portada trapezoidal de doble y triple jamba en su parte externa, as&iacute;&nbsp;como sus 8 hornacinas prism&aacute;ticas o triangular en la parte interior.</strong></tt></code></big></var></h3>\n\n			<h3><big><code><tt><strong><var>El recinto esta asociado a una plaza y a un canal que vierte agua sobre un peque&ntilde;o estanque llamado &quot;BA&Ntilde;OS DEL INKA&quot;, convertido en templo cristiano en honor a San Juan Bautista en 1536.</var>&nbsp;</strong></tt></code></big>&nbsp;</h3>\n			</td>\n		</tr>\n		<tr>\n			<td><img alt=\"\" src=\"../imagenes/publicaciones/4305df1825739e9071f21f8efcc08aeeIglesia-dentro.jpg\" style=\"border-style:solid; border-width:3px; height:200px; width:300px\" /></td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n', 'IGLESIA DE HUAYTARÁ', 1, 1, 'e13c8f32a6e2fec11a6cf6d1d4e4b155DentroIglesia.jpg', 10, 3390);
