(40, 11, 'IMAGEN', '2020-01-28 08:12:26', '<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td><img alt=\"\" src=\"../imagenes/publicaciones/48e74668f7053ac66c391a5a07ebf0c2Pacahamanca.jpg\" style=\"height:234px; width:350px\" /></td>\n		</tr>\n		<tr>\n			<td>\n			<h3><strong>La Pachamanca&nbsp;es un plato t&iacute;pico de la gastronom&iacute;a del Per&uacute;, elaborado por la cocci&oacute;n, al calor de piedras pre-calentadas, luego se coloca bajo tierra y se le cubre con hojas de platano para proteger del contacto con la tierra, se utiliza carnes de vacuno, cerdo, cabra y pollo&nbsp;previamente aderezados con ingredientes como aj&iacute; panca, pimienta&nbsp;y otras especias, junto con productos aut&oacute;ctonos andinos&nbsp;adicionales, como Papas, Camote, Choclo, Haba&nbsp;en vainas.</strong></h3>\n\n			<h3><strong>M&aacute;s all&aacute; de una comida o de un &aacute;gape, es un rito comunitario en el Ande y en las ciudades.</strong></h3>\n			</td>\n		</tr>\n		<tr>\n			<td><img alt=\"\" src=\"../imagenes/publicaciones/9b9c2be6c14ff332c71c0bf2b10ff46cpachamanca.jpg\" style=\"height:225px; width:300px\" /></td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n', 'Pachamanca', 1, 1, '9b9c2be6c14ff332c71c0bf2b10ff46cpachamanca.jpg', 11, 2242),
(41, 11, 'IMAGEN', '2020-01-28 08:14:36', '<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td><img alt=\"\" src=\"../imagenes/publicaciones/bca04e32166ed85f33a8cc7df4e00244Patasca1.jfif\" style=\"height:329px; width:400px\" /></td>\n		</tr>\n		<tr>\n			<td>\n			<h3><em><strong>Esta sopa toma el nombre de patasca, que es el Ma&iacute;z pelado y reventado con una cocci&oacute;n de horas en el fog&oacute;n agreg&aacute;ndose carne de res, carnero, mondongo, patas de ternera y hierbas de la regi&oacute;n andina.</strong></em></h3>\n\n			<h3><em><strong>En algunas regiones del Per&uacute; esta sopa se conoce con el nombre de sopa de mondongo debido a que esta lleva v&iacute;sceras en sus ingredientes, o tambi&eacute;n, particularmente en la Costa se le conoce como Sopa de Mote.</strong></em></h3>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n', 'Patasca', 1, 1, 'bca04e32166ed85f33a8cc7df4e00244Patasca1.jfif', 11, 2470),
(43, 10, 'IMAGEN', '2020-01-29 10:25:01', '<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td>\n			<p><img alt=\"\" src=\"../imagenes/publicaciones/c98c75c19918dfebcb29fdbade713304Inca-Huasi 8.jpg\" style=\"border-style:solid; border-width:2px; height:200px; width:300px\" /></p>\n			</td>\n		</tr>\n		<tr>\n			<td><img alt=\"\" src=\"../imagenes/publicaciones/62bf1edb36141f114521ec4bb417557911.jpg\" style=\"border-style:solid; border-width:2px; height:200px; width:300px\" /></td>\n		</tr>\n		<tr>\n			<td>\n			<h3><cite><strong>El Complejo arqueol&oacute;gico de Inca Huasi se encuentra ubicado en el distrito de Huaytar&aacute;, dentro del departamento de Huancavelica; a unos 3,775 msnm.</strong></cite></h3>\n\n			<h3><cite><strong>A unos 25 - 30&nbsp;minutos de la ciudad de Huaytar&aacute;, siguiendo por la carretera de la v&iacute;a Los Libertadores, camino a la ciudad de Ayacucho.</strong></cite></h3>\n\n			<h3><cite><strong>Es un complejo arquitect&oacute;nico cuyo nombre significa &ldquo;Casa del Inca&rdquo; y destaca en &eacute;l el llamado &ldquo;Palacio del Inca&rdquo;, la construcci&oacute;n de la cultura incaica m&aacute;s importante del departamento de Huancavelica. Se cree que es una de las tantas edificaciones que mandara a realizar en Inca Pachac&uacute;tec durante su gobierno, y data del a&ntilde;o&nbsp;1440 aproximadamente.</strong></cite></h3>\n\n			<h3><cite><strong>En cuanto al territorio en el que se encuentra asentado Incahuasi, este est&aacute; conformado por una serie de terrazas niveladas, en estas se pueden encontrar distintos edificios, entre los que destacan: plazas, recintos habitacionales, palacios, dep&oacute;sitos o colcas, canales, y lo m&aacute;s llamativo y que podr&iacute;a dar su funcionalidad al lugar: observatorios de car&aacute;cter astron&oacute;mico, como los llamados intihuatanas, conocidos tambi&eacute;n con el nombre de relojes solares y que ten&iacute;an la finalidad de poder leer los movimientos solares y predecir las &eacute;pocas de los solsticios y equinoccios</strong></cite>.</h3>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<p><img alt=\"\" src=\"../imagenes/publicaciones/b057559cae3fea7ad51a29ce97d9b190Inca-Huasi 4.jpg\" style=\"border-style:solid; border-width:2px; height:200px; width:300px\" /></p>\n			</td>\n		</tr>\n		<tr>\n			<td><img alt=\"\" src=\"../imagenes/publicaciones/f3ccdd27d2000e3f9255a7e3e2c488001.jpg\" style=\"border-style:solid; border-width:2px; height:200px; width:300px\" /></td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n', 'INCA-HUASI', 1, 1, 'c9d00102ba2aeae64ccfc20b37cb0b87IncaHuasi.jpg', 10, 3510);
INSERT INTO `publicaciones` (`idpublicaciones`, `idcategoria`, `idusuario`, `fecha`, `contenido_publicacion`, `titulo_publicacion`, `estado`, `comentarios`, `imagen_logo`, `idsubcatgegoria`, `vistas`) VALUES
(44, 4, 'IMAGEN', '2020-01-29 14:47:05', '<p class=\"MsoNormal\" style=\"text-align:justify\"><font size=\"3\" color=\"#444444\">- En su primer año de Gestión, el\nalcalde, Prof. Ricardo Yauricasa Flores ha logrado situar a la provincia de Huaytará\nen el primer lugar de la Región Huancavelica con respecto a la Ejecución\nPresupuestal de Gastos de Capital hasta el 31 de diciembre de 2019. Así lo dio\na conocer el Ministerio de Economía y Finanzas (MEF) a través de su portal web.</font></p><p class=\"MsoNormal\" style=\"text-align:justify\"><font size=\"3\" color=\"#444444\">- “Estoy muy contento por este\nresultado. Hemos trabajado ardua e incansablemente por nuestra provincia,\natendiendo las necesidades básicas de nuestra población y brindándoles una\nmejor calidad de vida”, manifestó el burgomaestre.</font></p><p class=\"MsoNormal\" style=\"text-align:justify\"><font size=\"3\" color=\"#444444\"><br></font></p><p class=\"MsoNormal\" style=\"text-align:justify\"><img src=\"data:image/jpeg;base64,\" class=\"\" style=\"margin: 0px; resize: none; position: relative; zoom: 1; display: block; height: 782px; width: 782px; top: 0px; left: 0px;\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"><font size=\"3\" color=\"#444444\">- “Esto no significa que nos\nquedamos conformes. Para este año (2020) nos hemos propuesto superar esta meta.\nTengo la satisfacción de contar con regidores que tienen el mismo el objetivo,\ny por supuesto, un gran equipo de trabajo, comprometido con la gestión”,\nañadió.<o:p></o:p></font></p><p class=\"MsoNormal\" style=\"text-align:justify\">\n\n</p><p class=\"MsoNormal\" style=\"text-align:justify\"><font size=\"3\" color=\"#444444\">- Cabe recalcar que Huaytará alcanzó\nun 85.54 % en Ejecución Presupuestal en 2019, superando a Acobamba (78.90 %),\nAngaraes (72.82 %) y Huancavelica (70.44 %). Asimismo, la “Capital Arqueológica\nde la Región Huancavelica” cumplió satisfactoriamente las metas del Plan de\nIncentivos.</font><o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align:justify\"><o:p></o:p></p>', 'MUNICIPALIDAD PROVINCIAL DE HUAYTARÁ OCUPA EL PRIMER LUGAR EN EJECUCIÓN PRESUPUESTAL DE GASTOS DE CAPITAL EN LA REGIÓN HUANCAVELICA', 1, 1, '374c50826a7597cdc17cae0125c1bbcdcorreo 2.jpeg', 8, 1209);
INSERT INTO `publicaciones` (`idpublicaciones`, `idcategoria`, `idusuario`, `fecha`, `contenido_publicacion`, `titulo_publicacion`, `estado`, `comentarios`, `imagen_logo`, `idsubcatgegoria`, `vistas`) VALUES
(45, 4, 'IMAGEN', '2020-01-29 15:50:30', '<p class=\"MsoNormal\"><font size=\"5\">- Por eso, este 15 y 16 de febrero, Huaytará está de fiesta.\nSe viene el XX concurso inter-anexos y XXVIII concurso inter-distritos del\nCarnaval Huaytarino o Pukllay 2020.<o:p></o:p></font></p>\n\n<p class=\"MsoNormal\"><font size=\"5\">- Invitamos a todos a ser parte de esta fiesta costumbrista y\ncompartir nuestras tradiciones.</font><o:p></o:p></p><p class=\"MsoNormal\"><font size=\"5\"><br></font></p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\"><font size=\"5\"><br></font></p>', 'VIVE EL CARNAVAL HUAYTARINO', 1, 1, '64828865e09a05184d5bcecfd52feadcafiche carnaval.jpeg', 8, 1701);
INSERT INTO `publicaciones` (`idpublicaciones`, `idcategoria`, `idusuario`, `fecha`, `contenido_publicacion`, `titulo_publicacion`, `estado`, `comentarios`, `imagen_logo`, `idsubcatgegoria`, `vistas`) VALUES
(46, 4, 'IMAGEN', '2020-01-30 06:52:57', '<p class=\"MsoNormal\" style=\"text-align:justify\"><b><font size=\"3\">La Municipalidad Provincial de\nHuaytará, a través de la Gerencia de Desarrollo Social y Servicios comunales,\nviene llevando a cabo las vacaciones útiles dirigido a niños y niñas del primer\nal cuarto grado de educación primaria. <o:p></o:p></font></b></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify\"><b><font size=\"3\">Las materias a reforzar son\ncomprensión lectora y razonamiento matemático, asimismo, se ha implementado el\ntaller de ajedrez.<o:p></o:p></font></b></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify\"><b><font size=\"3\">En esta oportunidad, los docentes\nresponsables son: el Prof. Jorge Luis Bustamante Ponce, y la Prof. Karin Gala\nConislla, con amplia experiencia en estas áreas.<o:p></o:p></font></b></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify\"><b><font size=\"3\">De esta manera, se busca mejorar\nla educación los niños y niñas de nuestro querido Huaytará, aprovechando las\nvacaciones para brindarles la enseñanza respectiva en áreas importantes para su\naprendizaje.<o:p></o:p></font></b></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify\"><b><font size=\"3\">Cabe recalcar que los días de\nestudio son los lunes, miércoles y viernes de 9:00 am a 12:30 pm y culminarán\nel 24 de febrero con una ceremonia de clausura en el frontis de la\nMunicipalidad Provincial de Huaytará.</font></b><o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><font size=\"3\"><br></font></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"></p><div class=\"ui-wrapper\" style=\"overflow: hidden; position: relative; width: 890.888px; height: 616px; top: 0px; left: 0px; margin: 0px;\"><img src=\"../imagenes/publicaciones/3f36ff24100aac1e25f148f6bbf76dc9afiche vacaciones utiles NUEVO.jpg\" class=\"\" style=\"margin: 0px; resize: none; position: static; zoom: 1; display: block; height: 614px; width: 889px; top: auto; left: auto;\"><div class=\"ui-resizable-handle ui-resizable-e\" style=\"z-index: 90;\"></div><div class=\"ui-resizable-handle ui-resizable-s\" style=\"z-index: 90;\"></div><div class=\"ui-resizable-handle ui-resizable-se ui-icon ui-icon-gripsmall-diagonal-se\" style=\"z-index: 90;\"></div></div><b><font size=\"3\"><br></font></b><p></p><div><b><font size=\"3\"><br></font></b></div><div><img src=\"../imagenes/publicaciones/7f88801a07f0b751739c7da48a990001editado 1.jpg\" class=\"\" style=\"margin: 0px; resize: none; position: relative; zoom: 1; display: block; height: 671px; width: 895px; top: 0px; left: 0px;\"><b><font size=\"3\"><br></font></b></div>', 'COMENZARON LAS VACACIONES ÚTILES', 1, 1, '3f36ff24100aac1e25f148f6bbf76dc9afiche vacaciones utiles NUEVO.jpg', 8, 1011),
