(51, 5, 'LUCAS', '2020-02-11 10:17:03', '<p><strong>Se declara, en La Regi&oacute;n Huancavelica, el Saneamiento F&iacute;sico Legal de Predios (Anotaci&oacute;n Preventiva), seg&uacute;n Art&iacute;culo 8 del D.S. N&ordm; 130-2001-EF, a Favor del Estado: MUNICIPALIDAD PROVINCIAL DE HUAYTARA, DE ACUERDO AL SIGUIENTE DETALLE:</strong></p>\n\n<hr />\n<hr />\n<p><img alt=\"\" src=\"../imagenes/publicaciones/8f203e46b726a9f70d2481b730193da1saneamiento.jpg\" style=\"height:707px; width:1280px\" /></p>\n', 'SANEAMIENTO LEGAL DE PREDIOS', 1, 1, '52af49691fb430994be26141526db3fbSANEMIENTO LEGAL4.jfif', 8, 1703),
(52, 2, 'IMAGEN', '2020-02-19 18:38:12', '<p><img alt=\"\" src=\"../imagenes/publicaciones/a8aa3cc011399c40593b8d7bce44f8f6scan025.jpg\" style=\"height:1000px; width:727px\" /></p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" src=\"../imagenes/publicaciones/743bd7ddc8c0e3004d7c0dd72578f590scan027.jpg\" style=\"height:1000px; width:727px\" /></p>\n', 'Resolución Sub Gerencial n° 011-2020-mph', 1, 0, 'a8aa3cc011399c40593b8d7bce44f8f6scan025.jpg', 8, 2489),
(53, 2, 'LUCAS', '2020-02-24 20:14:11', '<p><em>Este s&aacute;bado 15 de febrero se desarroll&oacute; el XX Concurso de Carnavales Inter-anexos 2020, donde participaron 06 anexos de nuestro distrito de Huaytar&aacute;, cuyos resultados fueron los siguientes:<br />\n<br />\nG&Eacute;NERO QUENA/GUITARRA:<br />\n1er Puesto: Chuquimar&aacute;n y Acco<br />\n<br />\nG&Eacute;NERO BANDA:<br />\n1er Puesto: Muchic<br />\n2do Puesto: Chocorvo<br />\n3er Puesto: Cuyahuasi<br />\n4to Puesto: Ccotanca<br />\n<br />\nCabe resaltar que hubo una comparsa de exhibici&oacute;n conformada por el barrio de Dos de Mayo, Tullpa y Saracoto, pertenecientes al anexo de Muchic.</em></p>\n\n<hr />\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td><img alt=\"\" src=\"../imagenes/publicaciones/83b5009e040969ee7b60362ad74265731.jpeg\" style=\"height:auto; width:40%\" />&nbsp;<img alt=\"\" src=\"../imagenes/publicaciones/ea571676ce9b75b0730a5d56350ae93e2.jpeg\" style=\"height:auto; width:40%\" /></td>\n		</tr>\n		<tr>\n			<td><img alt=\"\" src=\"../imagenes/publicaciones/b06e00b230527202d3420d52eb4760e115.jpeg\" style=\"height:auto; width:40%\" />&nbsp;<img alt=\"\" src=\"../imagenes/publicaciones/ddf9c9a45551e218c4018d5c53e9f6bb5.jpeg\" style=\"border-style:solid; border-width:1px; width:40%\" /></td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n', 'CARNAVALES HUAYTARINOS 2020: XX CONCURSO INTER-ANEXOS', 1, 1, '7b8e536e0fc6cedc941b2bb8d1c51902port.jpg', 4, 2073),
(58, 10, 'IMAGEN', '2020-02-28 11:10:21', '<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td><img alt=\"\" src=\"../imagenes/publicaciones/85b6f89b41cae26786ac72365fff771b16.jpg\" style=\"border-style:solid; border-width:2px; height:200px; width:300px\" /></td>\n		</tr>\n		<tr>\n			<td>\n			<h2 style=\"font-style:italic;\">El mirador de Huaytar&aacute;, desde aqu&iacute;&nbsp;se puede apreciar la vista panor&aacute;mica de la provincia de Huaytar&aacute;.&nbsp;</h2>\n			</td>\n		</tr>\n		<tr>\n			<td><img alt=\"\" src=\"../imagenes/publicaciones/7bca94505b07c9475619b7b1e7d02b9eMirador-Huaytara.jpg\" style=\"border-style:solid; border-width:2px; height:200px; width:300px\" /></td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n', 'Mirador de Huaytará', 1, 1, '85b6f89b41cae26786ac72365fff771b16.jpg', 10, 3248),
(59, 2, 'IMAGEN', '2020-03-06 13:43:40', '<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td><img alt=\"\" src=\"../imagenes/publicaciones/8275ae941710e02151f0427691d544f0portada dia de la mujer 2020.jpg\" style=\"border-style:solid; border-width:1px; height:111px; width:300px\" /></td>\n		</tr>\n		<tr>\n			<td>\n			<h2 style=\"font-style:italic;\">El D&iacute;a Internacional de la Mujer es un buen momento para reflexionar acerca de los avances logrados, pedir m&aacute;s cambios y celebrar la valent&iacute;a y la determinaci&oacute;n de las mujeres de a pie que han jugado un papel clave en la&nbsp;historia de sus pa&iacute;ses y comunidades.<br />\n			En 1972, la Asamblea General de las Naciones&nbsp;Unidas declar&oacute; a 1975 A&ntilde;o Internacional de la&nbsp;Mujer y en 1977 invit&oacute; a los Estados a declarar, conforme a sus tradiciones hist&oacute;ricas&nbsp;y costumbres nacionales, un d&iacute;a como D&iacute;a&nbsp;Internacional por los Derechos de la Mujer y la Paz Internacional.</h2>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n', 'Día Internacional de la Mujer', 1, 1, '8275ae941710e02151f0427691d544f0portada dia de la mujer 2020.jpg', 8, 1550),
(60, 9, 'IMAGEN', '2020-03-10 13:58:13', '<p>Conoce qu&eacute; es el coronavirus COVID-19 haciendo click <a href=\"https://www.gob.pe/institucion/minsa/campa%C3%B1as/699-conoce-que-es-el-coronavirus-covid-19\">aqu&iacute;.</a></p>\n\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td><img alt=\"\" src=\"../imagenes/publicaciones/ec5ee9320467d24b4b1e9e9c6340ffc8Coronavirus.jpeg\" style=\"border-style:solid; border-width:1px; height:169px; width:300px\" /></td>\n		</tr>\n		<tr>\n			<td>\n			<h3><var>Los coronavirus (CoV) son una amplia familia de virus que pueden causar diversas afecciones, desde el resfriado com&uacute;n hasta enfermedades m&aacute;s graves, como ocurre con el coronavirus causante del s&iacute;ndrome respiratorio de Oriente Medio (MERS-CoV) y el que ocasiona el s&iacute;ndrome respiratorio agudo severo (SRAS-CoV). Un nuevo coronavirus es una nueva cepa de coronavirus que no se hab&iacute;a encontrado antes en el ser humano.</var></h3>\n\n			<h3><var>Los coronavirus se pueden contagiar de los animales a las personas (transmisi&oacute;n zoon&oacute;tica). De acuerdo con estudios exhaustivos al respecto, sabemos que el SRAS-CoV se transmiti&oacute; de la civeta al ser humano y que se ha producido transmisi&oacute;n del MERS-CoV del dromedario al ser humano. Adem&aacute;s, se sabe que hay otros coronavirus circulando entre animales, que todav&iacute;a no han infectado al ser humano.</var></h3>\n\n			<h3><var>Esas infecciones suelen cursar con fiebre y s&iacute;ntomas respiratorios (tos y disnea o dificultad para respirar). En los casos m&aacute;s graves, pueden causar neumon&iacute;a, s&iacute;ndrome respiratorio agudo severo, insuficiencia renal e, incluso, la muerte.</var></h3>\n\n			<h3><var>Las recomendaciones habituales para no propagar la infecci&oacute;n son la buena higiene de manos y respiratoria (cubrirse la boca y la nariz al toser y estornudar) y la cocci&oacute;n completa de la carne y los huevos. Asimismo, se debe evitar el contacto estrecho con cualquier persona que presente signos de afecci&oacute;n respiratoria, como tos o estornudos.</var></h3>\n			</td>\n		</tr>\n		<tr>\n			<td><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/QKDKgcGuVZs\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe></td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n', 'Conoce qué es el coronavirus COVID-19', 1, 1, '3f14f18534658448550e091daeeb5375coronavirus.jpg', 2, 2445),
(61, 2, 'IMAGEN', '2020-04-24 19:44:33', '<p>&nbsp;</p>\n\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse:collapse\">\n	<tbody>\n		<tr>\n			<td>\n			<h2 style=\"font-style:italic;\">Padr&oacute;n Oficial de los beneficiarios de la Canasta B&aacute;sica Familiar por el COVID-19, en el marco normativo Decreto de Supremo N&deg; 044-2020-PCM. y el Decreto de Urgencia N&deg; 033-2020</h2>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<h3><a href=\"http://munihuaytara.gob.pe/documentos_gestion.php?tipo=13\">Padr&oacute;n Oficial de los beneficiarios de la Canasta B&aacute;sica Familiar por el COVID-19</a></h3>\n			</td>\n		</tr>\n		<tr>\n			<td>&nbsp;</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n', 'Padrón Oficial de los beneficiarios de la Canasta Básica Familiar por el COVID-19', 1, 1, '1c0e86b11b959fd3df1fd6622d2ffd8dLogoMuniHuaytara.jpg', 8, 2305),
