(63, 5, 'LUCAS', '2020-09-22 10:14:10', '<p><strong>SE DECLARA, EN LA REGI&Oacute;N HUANCAVELICA, PROVINCIA DE HUAYTAR&Aacute;, EL SANEAMIENTO F&Iacute;SICO LEGAL DE PREDIO (ANOTACI&Oacute;N PREVENTIVA), SEG&Uacute;N ART&Iacute;CULO 8 DEL D.S. N&ordm; 130-2001-EF, A FAVOR DE LA MUNICIPALIDAD PROVINCIAL DE HUAYTAR&Aacute; (MPH), SEG&Uacute;N DETALLE:SE DECLARA, EN LA REGI&Oacute;N HUANCAVELICA, PROVINCIA DE HUAYTAR&Aacute;, EL SANEAMIENTO F&Iacute;SICO LEGAL DE PREDIO (ANOTACI&Oacute;N PREVENTIVA), SEG&Uacute;N ART&Iacute;CULO 8 DEL D.S. N&ordm; 130-2001-EF, A FAVOR DE LA MUNICIPALIDAD PROVINCIAL DE HUAYTAR&Aacute; (MPH), SEG&Uacute;N DETALLE:</strong></p>\n\n<p><strong><img alt=\"\" src=\"../imagenes/publicaciones/3e01196747f467e8b16cc1d11c0df277scan068.jpg\" style=\"width:100%\" /></strong></p>\n', 'SANEAMIENTO LEGAL DE PREDIOS', 1, 1, '3e01196747f467e8b16cc1d11c0df277scan068.jpg', 8, 1588),
(64, 2, 'IMAGEN', '2021-02-09 06:41:01', '<p>Nuestro pa&iacute;s actualmente est&aacute; pasando por una emergencia sanitaria, por este motivo, el Ministerio de Educaci&oacute;n desarroll&oacute; la plataforma educativa &ldquo;Aprendo en Casa&rdquo; que se transmite en diferentes medios masivos como internet, televisi&oacute;n y radio, y llega a todas las poblaciones, sin costo alguno y con acceso libre.</p>\n\n<p>Si bien es cierto, es una plataforma que se cre&oacute; hace unos meses por la pandemia, pero ha tenido tanto &eacute;xito, que cada vez tiene diferentes contenidos para cada uno de los niveles de educaci&oacute;n escolar. Los materiales que tiene el &ldquo;Aprendo en Casa&rdquo; son gu&iacute;as de aprendizaje, videos. Audios, cuadernos de trabajo, entre otros materiales, tomando en cuenta cada una de las materias de la planificaci&oacute;n estudiantil.</p>\n\n<p>Es tan importante que el Ministerio de Transporte y Comunicaciones ha logrado ejecutar distintas iniciativas de ampliaci&oacute;n de cobertura para que la plataforma educativa llegue a m&aacute;s zonas del Per&uacute;. Por otro lado, se ha realizado convenios con empresas de telecomunicaciones para que al acceder al sitio web no consuma datos en la poblaci&oacute;n y se aumente la potencia de transmisi&oacute;n.</p>\n\n<p>Tambi&eacute;n, se han brindado los permisos al Instituto de Radio y Televisi&oacute;n del Per&uacute; para dar el servicio de radiodifusi&oacute;n por sat&eacute;lites para las poblaciones m&aacute;s alejadas. Por &uacute;ltimo, es necesario decir que Ministerio de Educaci&oacute;n sigue trabajando de forma permanente para que todos los peruanos tengan la posibilidad de una buena educaci&oacute;n.</p>\n\n<p>M&Aacute;S INFORMACI&Oacute;N:</p>\n\n<p><a href=\"https://resources.aprendoencasa.pe/perueduca/orientaciones/familia/familia-orientaciones-que-es-aprendo-en-casa.pdf\">https://resources.aprendoencasa.pe/perueduca/orientaciones/familia/familia-orientaciones-que-es-aprendo-en-casa.pdf</a></p>\n\n<p>Fuente: <a href=\"https://selectra.com.pe/info/aprendo-en-casa\">https://selectra.com.pe/info/aprendo-en-casa</a></p>\n', 'Plataforma Educativa \"Aprendo en Casa\" ', 1, 0, 'b8500bf0778bc438f96140643074e3cf1597000197_932661_1597000327_noticia_normal.jpg', 2, 1580),
(65, 2, 'LUCAS', '2021-03-17 16:37:40', '<p><strong>Se comunica a la poblaci&oacute;n de Huaytara en general de la Unidad de Patrimonio, viene ejecutando el proceso de saneamiento de bienes sobrantes en concordancia a lo establecido en el decreto legislativo N&deg; 217 2019 EF.</strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>Puede Verificar con mas detalle en el siguiente link:</strong></p>\n\n<p><a href=\"http://munihuaytara.gob.pe/adminweb/imagenes/publicaciones/3962a1893209194cb4e77469b51c98c5COMUNICADO%20N%C2%B0%20001.pdf\"><strong>http://munihuaytara.gob.pe/adminweb/imagenes/publicaciones/3962a1893209194cb4e77469b51c98c5COMUNICADO%20N%C2%B0%20001.pdf</strong></a></p>\n\n<p><strong><img alt=\"\" src=\"../imagenes/publicaciones/f3ccdd27d2000e3f9255a7e3e2c488001.jpg\" /></strong></p>\n\n<p><strong><img alt=\"\" src=\"../imagenes/publicaciones/156005c5baf40ff51a327f1c34f2975b2.jpg\" /></strong></p>\n', 'Se comunica a la población de Huaytara en general de la Unidad de Patrimonio', 0, 0, 'f3ccdd27d2000e3f9255a7e3e2c488001.jpg', 9, 1587),
(67, 2, 'IMAGEN', '2022-09-08 09:57:21', '<p>Actas de Publicaci&oacute;n del Padr&oacute;n de Titulares en conformidad con lo dispuesto por el art&iacute;culo 29&deg; del Reglamento de Formalizaci&oacute;n de la propiedad informal de terrenos ocupados por posesionarios informales, centros Urbanos Informales, urbanizaciones populares aprobada por DS 006-2006-VIVIENDA suscriben la presente, un acta representantes de COFOPRI en calidad de testigos de la publicaci&oacute;n efectuada.</p>\r\n\r\n<p>Puede visualizar las actas haciendo en este <a href=\"http://munihuaytara.gob.pe/adminweb/imagenes/publicaciones/ActasPublicacionPadronTitulares.pdf\" target=\"_blank\">enlace</a>.</p>', 'ACTAS DE PUBLICACION DEL PADRON DE TITULARES', 1, 0, '1c0e86b11b959fd3df1fd6622d2ffd8dLogoMuniHuaytara.jpg', 9, 378),
(68, 2, 'IMAGEN', '2022-10-11 14:29:53', '<h1>PLAN DE DESARROLLO URBANO 2022 - 2032</h1>\r\n\r\n<hr />\r\n<p><strong>S</strong>e da inicio a la exhibici&oacute;n del Proyecto del Plan de Desarrollo Urbano (PDU) de Huaytar&aacute; 2022-2032, y su publicaci&oacute;n por el plazo de treinta (30) d&iacute;as calendarios, computados desde el 05 de octubre de 2022 hasta el 04 de noviembre de 2022, en las instalaciones de la Municipalidad, p&aacute;gina web y en medios de comunicaci&oacute;n; as&iacute; mismo se establece el plazo de15 d&iacute;as calendarios para el levantamiento de observaciones por consultor&iacute;a y del p&uacute;blico en general.</p>\r\n\r\n<p>Puedes descargar los documentos referentes al PDU haciendo click <a href=\"http://munihuaytara.gob.pe/PDU/pdu-huaytara-6to-entregable-cd_2022-11-21_0421.zip\">aqu&iacute;</a>!</p>\r\n\r\n<hr />\r\n<p><img alt=\"Resolución de Alcaldía\" src=\"http://munihuaytara.gob.pe/PDU/Resolucion%20Alcaldia%20N%20171-2022-MPH_page-0001.jpg\" style=\"height:1755px; width:1240px\" /><img alt=\"Resolución de Alcaldía\" src=\"http://munihuaytara.gob.pe/PDU/Resolucion%20Alcaldia%20N%20171-2022-MPH_page-0002.jpg\" style=\"height:1755px; width:1240px\" /></p>\r\n\r\n<hr />\r\n<h2><strong>Para presentar tus observaciones sobre el PDU hazlo en tres pasos:</strong></h2>\r\n\r\n<ol>\r\n	<li>Descarga la ficha en el siguiente <a href=\"http://munihuaytara.gob.pe/PDU/PDU%20Huaytara%20-%20F1%20Registro%20Observaciones-Recomendaciones.xlsx\">enlace</a>.</li>\r\n	<li>Rellena la ficha y luego impr&iacute;mela.</li>\r\n	<li>Ac&eacute;rcate y presenta la ficha en la oficina de Mesa de Partes de la Municipalidad Provincial de Huaytar&aacute;.</li>\r\n</ol>\r\n', 'PDU', 1, 0, '0befa83614368ea4374f71684039b66bPDU.jpg', 8, 408);
